import './App.css';
import Navbar from './Component/Navbar/Navbar';
import {BrowserRouter , Routes , Route} from 'react-router-dom';
import Shop from './Pages/Shop';
import Cart from ''

function App() {
  return (
    <div>
        <BrowserRouter>


        <Navbar />
        <Routes>
            <Route path='/' element={<Shop/>}/>
            <Route path='/cart' element={<Cart/>}/>
        </Routes>


        </BrowserRouter>


    </div>
  );
}

export default App;
